import { Component } from '@angular/core';
import {Router} from "@angular/router";

@Component({
  selector: 'app-psychometric-test',
  templateUrl: './psychometric-test.component.html',
  styleUrls: ['./psychometric-test.component.css']
})
export class PsychometricTestComponent {


  constructor(private router:Router) {

  }


  GoFirst(){
    this.router.navigate(['/first-question']);
  }



}



<html lang="en" >
<head>
<title> Psychometric-test</title>
</head>

<body>
<ul>
  <li><a href="#Main_Dashboard">Home</a></li>
  <li><a href="#news">Test</a></li>
  <li><a href="Vacancy">Vacancy</a></li>
  <li><a href="#Community">Community</a></li>
  <li><a href="#Newsfeed">Newsfeed</a></li>
</ul>

<div class="ptimg">
  <img src="/assets/img/Psychometric-test.png" >

</div>

<div class="bottom">

<button (click)="GoFirst()" class="ghost"> Start</button>


</div>





</body>
</html>
